package colormap

import (
	"fmt"
	"image/color"
	"math"
	"strings"
)

type Colormap struct {
	Colors []color.Color
}

func New(colors []color.Color) *Colormap {
	return &Colormap{colors}
}

func (c *Colormap) Reversed() *Colormap {
	colors := make([]color.Color, len(c.Colors))
	copy(colors, c.Colors)
	for i, j := 0, len(colors)-1; i < j; i, j = i+1, j-1 {
		colors[i], colors[j] = colors[j], colors[i]
	}
	return &Colormap{colors}
}

func (c *Colormap) At(t float64) color.Color {
	n := len(c.Colors)
	if t <= 0 || math.IsNaN(t) {
		return c.Colors[0]
	}
	if t >= 1 {
		return c.Colors[n-1]
	}
	i := int(math.Floor(t * float64(n-1)))
	s := 1 / float64(n-1)
	p := (t - float64(i)*s) / s
	return lerpColors(c.Colors[i], c.Colors[i+1], p)
}

func clamp(x, lo, hi float64) float64 {
	if x < lo {
		return lo
	}
	if x > hi {
		return hi
	}
	return x
}

func lerpColors(c0, c1 color.Color, t float64) color.Color {
	if t <= 0 {
		return c0
	}
	if t >= 1 {
		return c1
	}
	r0, g0, b0, a0 := c0.RGBA()
	r1, g1, b1, a1 := c1.RGBA()
	fr0, fg0, fb0, fa0 := float64(r0), float64(g0), float64(b0), float64(a0)
	fr1, fg1, fb1, fa1 := float64(r1), float64(g1), float64(b1), float64(a1)
	fr := clamp(fr0+(fr1-fr0)*t, 0, 0xffff)
	fg := clamp(fg0+(fg1-fg0)*t, 0, 0xffff)
	fb := clamp(fb0+(fb1-fb0)*t, 0, 0xffff)
	fa := clamp(fa0+(fa1-fa0)*t, 0, 0xffff)
	r := uint16(fr)
	g := uint16(fg)
	b := uint16(fb)
	a := uint16(fa)
	// TODO: this might not be handling alpha properly
	return color.RGBA64{r, g, b, a}
}

func ParseColors(x string) []color.Color {
	var result []color.Color
	for i := 0; i < len(x); i += 6 {
		result = append(result, ParseColor(x[i:i+6]))
	}
	return result
}

func ParseColor(x string) color.Color {
	x = strings.Trim(x, "#")
	var r, g, b, a int
	a = 255
	switch len(x) {
	case 3:
		fmt.Sscanf(x, "%1x%1x%1x", &r, &g, &b)
		r = (r << 4) | r
		g = (g << 4) | g
		b = (b << 4) | b
	case 4:
		fmt.Sscanf(x, "%1x%1x%1x%1x", &r, &g, &b, &a)
		r = (r << 4) | r
		g = (g << 4) | g
		b = (b << 4) | b
		a = (a << 4) | a
	case 6:
		fmt.Sscanf(x, "%02x%02x%02x", &r, &g, &b)
	case 8:
		fmt.Sscanf(x, "%02x%02x%02x%02x", &r, &g, &b, &a)
	}
	return color.NRGBA64{
		uint16(r | r<<8),
		uint16(g | g<<8),
		uint16(b | b<<8),
		uint16(a | a<<8),
	}
}

